import React from "react";
import Jumbotron from "react-bootstrap/Jumbotron";

function ProjectBanner({title, author}) {
  return (
      <Jumbotron className="w-100 justify-content-start align-items-end">
          <h1>{title}</h1>
          <h4>Encargado: {author}</h4>
      </Jumbotron>
  );
}

export default ProjectBanner;
